import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('SairaSemiCondensed-Regular-normal.ttf', font);
this.addFont('SairaSemiCondensed-Regular-normal.ttf', 'SairaSemiCondensed-Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])

export {callAddFont}
